INSERT INTO `website_faculties` (`website_faculties_id`, `website_faculties_name`, `department_head`, `msg_from_head`, `lab_info`, `created_at`, `updated_at`) VALUES (6,'Computer Science & Technology',1539269726,'Welcome to the Department of Computer Science & Technology of TMSS Institute of Science and ICT (TISI). I am happy that you have chosen to find out more about our department.\r\n\r\nProfessor Dr. Hosne-Ara Begum (Executive Director) walked the path of vow to alleviate poverty. Where she has seen that not only the poor have to be supported, but also the poor, especially the people of the northern part of the country. If we want to move forward, we will need a quality education system. The Technical Education Institute wanted to nurture that idea and build it with emphasis on career-oriented education. In this context, TMSS established the Institute of Science and ICT (TISI) in a shady and nice environment near the Bonani bypass road,Bogura and with the approval of the Bangladesh Board of Technical Education in 2017, also thanks to our Madam Nigar Sultana (Director of ICT), Sir M Khairul Islam [Consultant(TMSS ICT)], Sir Subroto Subon Acharjee (Principal of TISI), Their effective initiative brings our academic activity successful.\r\n\r\nWe live in a technological age, and technology is at the heart of what we do in CST – we design, develop, and advance modern technologies in order to improve our world and our quality of life.\r\n\r\nLooking forward, at the Computer Science & Technology course at TISI, we have identified five long-terms goals to support advancement in teaching and research:\r\n\r\n➔	Sustaining and attractive first class computer science department for diploma students\r\n➔	Offer courses that are attractive to students outside the concentration.\r\n➔	The Department provides an outstanding research environment complemented by excellence in teaching. The CST course has a comprehensive curriculum on topics related to all aspects of Computer Hardware and Software with an emphasis on practical learning. The course structure is designed by BTEB to equip our students with the latest developments in Computer Science & Technology.\r\n➔	The Department has state of the art infrastructure,lab facilities and computing equipment supported by high speed internet and wi-fi network.\r\n➔	Teaching here has really been a privilege for me.\r\n\r\nI am very happy to welcome you to the website of our department and hope that you find the necessary information you are seeking for and many more.','104','2021-08-16 15:33:00','2020-05-17 22:51:59');
/*!40000 ALTER TABLE `website_faculties` ENABLE KEYS */;
UNLOCK TABLES;

